import React, { Component } from 'react';
import './App.css';

class WhyHome extends Component {

    render(){
      return(
        <div className="main">
        <div className="maintext">
          <div className="typewriter">
            Start your Oxbridge journey.
          </div>
          <div className="findouthow">
              Find out how.
            </div>
        </div>
        </div>
      )
    }
  }

export default WhyHome
